import "./MyPosts.css";

function MyPosts() {
  return (
    <div>
      <div>My Posts</div>
      <div>New Posts</div>
      <div className="posts">
        <div className="item1">post 1</div>
        <div className="item2">post 2</div>
      </div>
    </div>
  );
}

export default MyPosts;
